import React from 'react';
import { generatorStyle, Button, ButtonText } from './generatorStyle';
import './Generator.css'






const Generator = () => {
  
  return (
  <div className="Generator" style={generatorStyle}>
    
      <Button><ButtonText>GENERATE DATA</ButtonText></Button>
   
     
    
    
  
  </div>
    
    
  )
}


export default Generator;
